import React from 'react';
import { Button as RButton, StyleSheet } from 'react-native';

const Button = () => {
  return <RButton style={styles.button}>asd</RButton>;
};

const styles = StyleSheet.create({
  button: {
    fontSize: 30,
    width: '30px',
    height: '30px',
  },
});

export default Button;
